import React from 'react';

const Arrow = ({ direction, clickFunction, glyph }) => (
    <div
      className={ `slide-arrow ${direction}` }
      onClick={ clickFunction }>
      { glyph } 
    </div>
  );

  //glyph refers to the content of the component

  export default Arrow;
